import React, { useEffect } from "react";
import { Button } from "reactstrap";
import { getBooking } from "../redux/actions/bookingAction";
import { connect } from "react-redux";

const MyBooking = ({ booking ,getBooking}) => {
  useEffect(() => {
      getBooking()
      console.log(booking)
  }, []);
  return (
    <div>
      {booking? <h1>{booking.msg}</h1>:<h1>No booking</h1>}
      <Button color="danger">Cancel booking</Button>
    </div>
  );
};

const mapStateToProps = (state) => ({
  booking: state.bookingReducer,
});

export default connect(mapStateToProps, { getBooking })(MyBooking);
